import React from 'react';
import PeopleCard from './PeopleCard'



const PeopleList = ({array}) => {

	return (

		<div>
		{ 
			
			array.map((heros,i) => {
				return (
					<PeopleCard
					key={i}
					name={array2[i].name}
					gender={array2[i].gender}
					height={array2[i].height}
					mass={array2[i].mass}
					/>

					);
			})

		}
		</div>
		)
		}


export default PeopleList
